import PropTypes from 'prop-types';
import Modal from '../../shared/Modal/Modal';
import Input from '../../shared/Input/Input';

const CreateConfigurationModal = props => {
    const { isVisible, showModal, closeModal, onNewConfigurationModalOk, onNewConfigurationModalCancel } = props;

    return (
        <Modal
            isVisible={isVisible}
            showModal={showModal}
            closeModal={onNewConfigurationModalClose}
            onOk={onOk}
            onNewConfigurationModalCancel={onNewConfigurationModalCancel}
            className={'mb-32'}
            title={'test'}
            showClose
            showFooter
        >
            <Input type={'text'} placeholder={'Name'} />
        </Modal>
    );
};

CreateConfigurationModal.propTypes = {};

export default CreateConfigurationModal;
